import React from 'react';
import CardMovie from '../components/CardMovie'
import styles from '../style/Home.module.scss';
import bg from '../img/bg.jpg';

const Home = () => {
    return (

        <div className={styles.body, col - md - 8}>
            <div className={styles.video}>
                <img src={bg} alt="bg" />
            </div>
            <h2>Latests</h2>
            <CardMovie />
        </div>

    )
}
export default Home
